import { ValuesType } from "types/types";
import st from "./Check.module.scss";

interface Props {
  values: ValuesType;
}

export const Check = ({ values }: Props) => {
  console.log(values);

  return (
    <div className={st.check_container}>
      <div>
        <div className={st.value}>{values.lastname}</div>
      </div>
      <div>
        <div className={st.value}>{values.firstname}</div>
      </div>
      <div>
        <div className={st.value}>{values.birth.month}</div>
      </div>
      <div>
        <div className={st.value}>{values.birth.date}</div>
      </div>
      <div>
        <div className={st.value}>{values.birth.year}</div>
      </div>
      <div>
        <div className={st.value}>{values.gender}</div>
      </div>
      <div>
        <div className={st.value}>{values.email}</div>
      </div>
      <div>
        <div className={st.value}>{values.id.id}</div>
      </div>
      <div>
        <div className={st.value}>{values.id.pw}</div>
      </div>
    </div>
  );
};

export default Check;
